import time

class Solution:
    def shiftingLetters1(self, S, shifts):
        """
        :type S: str
        :type shifts: List[int]
        :rtype: str
        """
        l = [0] * len(shifts)
        str_list = list(S)
        for i in range(0, len(shifts)):
            for j in range(i, len(shifts)):
                l[i] += shifts[j]
        for i in range(0, len(l)):
            num = ord(S[i])
            num = (l[i] + num - 97) % 26 + 97
            str_list[i] = chr(num)
        return ''.join(str_list)

    def shiftingLetters(self, S, shifts):
        """
        :type S: str
        :type shifts: List[int]
        :rtype: str
        """
        str_list = list(S)
        n = len(shifts)
        pre = 0
        i = n - 1
        while i >= 0:
            pre = (pre + shifts[i] % 26) % 26
            temp = (ord(S[i]) - 97 + pre) % 26 + 97
            str_list[i] = chr(temp)
            i -= 1

        return ''.join(str_list)


